  return (
    <div>
      <div className="max-w-screen-xl mx-auto mt-12 px-4 py-8">
        <h1 className="text-3xl font-bold">Tour Buddies Terms and Conditions</h1>
        {/* Add content here */}
      </div>
      <Footer />
    </div>
  );
};

export default TourBuddyTerms;
